import axios from "axios";

const url = "https://api.github.com/users/example";

const Fetch = async (username) => {
  const changableurl = `${url}/${username}`;
  try {
    const { data } = await axios.get(url);
    return data;
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
